import React from 'react';
import './Login.css';
import { Link } from 'react-router-dom';

function Login() {
    return (
        <div className="login">
            <Link to="/" className="login-logo" />
            <h2 className="login-title">Добро пожаловать!</h2>
            <fieldset className="login-fieldset">
                
            </fieldset>
        </div>
    )
}

export default Login;
